INSERT INTO `erp_database` (`projectCode`, `Title`, `Department`, `subHeads`, `Software`, `Hardware`, `catlogCode`, `Domain`, `id`, `abstract`, `docFile`, `synImg`) VALUES
('CIN0217', 'ADAPTIVE FORWARDING DELAY CONTROL FOR VANET DATA A', 'SOFTWARE PROJECTS', 'CSN-NETWORKING', 0, 4000, 'CIN0217', 'VEHICULAR AD HOC NETWORK', 231, 'AbstractIn-network data aggregation is a useful technique to reduce redundant data and to improve communication efficiency.\r\nTraditional data aggregation schemes for wireless sensor networks usually rely on a fixed routing structure to ensure data can be\r\naggregated at certain sensor nodes. However, they cannot be applied in highly mobile vehicular environments. In this paper, we\r\npropose an adaptive forwarding delay control scheme, namely Catch-Up, which dynamically changes the forwarding speed of nearby\r\nreports so that they have a better chance to meet each other and be aggregated together. The Catch-Up scheme is designed based on\r\na distributed learning algorithm. Each vehicle learns from local observations and chooses a delay based on learning results. The\r\nsimulation results demonstrate that our scheme can efficiently reduce the number of redundant reports and achieve a good trade-off\r\nbetween delay and communication overhead.', '', 'CIN0217.pdf'),
('CMP0194', '* GRID-CONNECTED BOOST-HALF-BRIDGE PHOTOVOLTAIC\r\nM', 'MATLAB PROJECTS', 'CSM-MATLAB', 13500, 3000, 'CMP0194', 'nil', 232, 'AbstractThis paper presents a novel grid-connected boosthalf-\r\nbridge photovoltaic (PV) microinverter system and its control\r\nimplementations. In order to achieve low cost, easy control, high\r\nefficiency, and high reliability, a boost-half-bridge dcdc converter\r\nusingminimal devices is introduced to interface the low-voltage PV\r\nmodule. A full-bridge pulsewidth-modulated inverter is cascaded\r\nand injects synchronized sinusoidal current to the grid. Moreover, a\r\nplug-in repetitive current controller based on a fourth-order linearphase\r\nIIR filter is proposed to regulate the grid current.High power\r\nfactor and very low total harmonic distortions are guaranteed under\r\nboth heavy load and light load conditions. Dynamic stiffness\r\nis achieved when load or solar irradiance is changing rapidly. In\r\naddition, the dynamic behavior of the boost-half-bridge dcdc converter\r\nis analyzed; a customized maximum power point tracking\r\n(MPPT) method, which generates a ramp-changed PV voltage reference\r\nis developed accordingly. Variable step size is adopted such\r\nthat fast tracking speed and high MPPT efficiency are both obtained.\r\nA 210W prototype was fabricated and tested. Simulation\r\nand experimental results are provided to verify the validity and\r\nperformance of the circuit operations, current control, and MPPT\r\nalgorithm', 'CMP0194.jpg', 'CMP0194.pdf'),
('CMI0251', 'AN ADAPTIVE NEURAL-FUZZY APPROACH FOR OBJECT DETEC', 'MATLAB PROJECTS', 'CSM-MATLAB', 0, 4500, 'CMI0251', 'SURVIVALLENCE', 233, 'AbstractDue to the long propagation delay and high error\r\nrate of acoustic channels, it is very challenging to provide reliable\r\ndata transfer for time-critical applications in an energy-efficient\r\nway. On the one hand, traditional retransmission upon failure\r\nusually introduces very large end-to-end delay and is thus not\r\nproper for time-critical services. On the other hand, common\r\napproaches without retransmission consume lots of energy. In this\r\npaper, we propose a new multipath power-control transmission\r\n(MPT) scheme, which can guarantee certain end-to-end packet\r\nerror rate while achieving a good balance between the overall\r\nenergy efficiency and the end-to-end packet delay. MPT smartly\r\ncombines power control with multipath routing and packet combining\r\nat the destination. With carefully designed power-control\r\nstrategies, MPT consumes much less energy than the conventional\r\none-path transmission scheme without retransmission. Besides,\r\nsince no hop-by-hop retransmission is allowed, MPT introduces\r\nmuch shorter delays than the traditional one-path scheme with\r\nretransmission. We conduct extensive simulations to evaluate\r\nthe performance of MPT. Our results show that MPT is highly\r\nenergy-efficient with low end-to-end packet delays.', '', 'CMI0251.pdf'),
('CHV0215', 'A METHOD TO CONSTRUCT LOW DELAY SINGLE ERROR\r\nCORR', 'ELECTRICAL, ELECTRONICS, COMMUNICATION & INSTRUMEN', 'CSV-VLSI', 6000, 5000, 'CHV0215', 'ERROR CORRECTING CODES', 234, 'Error correction codes (ECCs) have been used for decades\r\nto protect memories from soft errors. Single error correction (SEC) codes\r\nthat can correct 1-bit error per word are a common option for memory\r\nprotection. In some cases, SEC codes are extended to also provide double\r\nerror detection and are known as SEC-DED codes. As technology scales,\r\nsoft errors on registers also became a concern and, therefore, SEC codes\r\nare used to protect registers. The use of an ECC impacts the circuit\r\ndesign in terms of both delay and area. Traditional SEC or SEC-DED\r\ncodes developed for memories have focused on minimizing the number of\r\nredundant bits added by the code. This is important in a memory as those\r\nbits are added to each word in the memory. However, for registers used\r\nin circuits, minimizing the delay or area introduced by the ECC can be\r\nmore important. In this paper, a method to construct low delay SEC or\r\nSEC-DED codes that correct errors only on the data bits is proposed. The\r\nmethod is evaluated for several data block sizes, showing that the new\r\ncodes offer significant delay reductions when compared with traditional\r\nSEC or SEC-DED codes. The results for the area of the encoder and\r\ndecoder also show substantial savings compared to existing codes.', 'CHV0215.jpg', 'CHV0215.pdf'),
('CHT0002', 'A HIGH SPEED LOW POWER CAM WITH A PARITY BIT AND\r\n', 'ELECTRICAL, ELECTRONICS, COMMUNICATION & INSTRUMEN', 'CSV-VLSI', 0, 5000, 'CHT0002', 'RAM DESIGN', 235, 'Content addressable memory (CAM) offers high-speed\r\nsearch function in a single clock cycle. Due to its parallel match-line\r\n??  comparison, CAM is power-hungry. Thus, robust, high-speed and\r\nlow-power sense amplifiers are highly sought-after in CAM designs.\r\nIn this paper, we introduce a parity bit that leads to 39% sensing delay\r\nreduction at a cost of less than 1% area and power overhead. Furthermore,\r\nwe propose an effective gated-power technique to reduce the peak and\r\naverage power consumption and enhance the robustness of the design\r\nagainst process variations. A feedback loop is employed to auto-turn off\r\nthe power supply to the comparison elements and hence reduce the average\r\npower consumption by 64%. The proposed design can work at a supply\r\nvoltage down to 0.5 V.', 'CHT0002.jpg', 'CHT0002.pdf'),
('CIN0219', 'SLEEP SCHEDULING FOR CRITICAL EVENT MONITORING IN ', 'SOFTWARE PROJECTS', 'CSN-NETWORKING', 0, 4000, 'CIN0219', 'WIRELESS SENSOR NETWORK', 236, 'AbstractIn this paper, we focus on critical event monitoring in wireless sensor networks (WSNs), where only a small number of\r\npackets need to be transmitted most of the time. When a critical event occurs, an alarm message should be broadcast to the entire\r\nnetwork as soon as possible. To prolong the network lifetime, some sleep scheduling methods are always employed in WSNs,\r\nresulting in significant broadcasting delay, especially in large scale WSNs. In this paper, we propose a novel sleep scheduling method\r\nto reduce the delay of alarm broadcasting from any sensor node in WSNs. Specifically, we design two determined traffic paths for the\r\ntransmission of alarm message, and level-by-level offset based wake-up pattern according to the paths, respectively. When a critical\r\nevent occurs, an alarm is quickly transmitted along one of the traffic paths to a center node, and then it is immediately broadcast by the\r\ncenter node along another path without collision. Therefore, two of the big contributions are that the broadcasting delay is independent\r\nof the density of nodes and its energy consumption is ultra low. Exactly, the upper bound of the broadcasting delay is only 3D  2L,\r\nwhere D is the maximum hop of nodes to the center node, L is the length of sleeping duty cycle, and the unit is the size of time slot.\r\nExtensive simulations are conducted to evaluate these notable performances of the proposed method compared with existing works.', '', 'CIN0219.pdf'),
('CLC0037', 'ATM  MACHINE', 'SOFTWARE PROJECTS', 'CSN-NETWORKING', 0, 2000, 'CLC0037', 'nil', 237, ' The aim of this project is to derive an Automated Teller Machine (ATM) for the Cooperative Bank. This bank has just realized that they are losing customers because they dont offer their customers access to their own ATMs', '', 'CLC0037.doc'),
('CLC0038', 'ELECTRICITY BILL MANAGEMENT SYSTEM', 'SOFTWARE PROJECTS', 'CSN-NETWORKING', 0, 2000, 'CLC0038', 'nil', 238, 'ELECTRICITY BILL MANAGEMENT SYSTEM\r\n\r\nPROJECT DESCRIPTION\r\n\r\n	Electricity bill management system is the software or a program to print the Electricity bill of a given customer. The program will read customer idno; name and unit consumed by the user and print the total amount to pay. Along with this, it displays the due date to pay the bill and also prints the extra fee that the customer needs to be pay if they cross the due date', '', 'CLC0038.doc'),
('CLC0039', 'EXAMINATION HALL MANAGEMENT SYSTEM', 'SOFTWARE PROJECTS', 'CSO-OTHERS', 0, 2000, 'CLC0039', 'nil', 239, 'EXAMINATION HALL MANAGEMENT SYSTEM\r\n\r\nPROJECT DESCRIPTION:\r\n	\r\n		Examination hall management system is software used to manage the complex and time consuming tasks associated with the hall allotment. The system asks for subjects of the exam to be conducted and the number of students in each subject with their roll numbers. Then depending on the number of halls and benches availability, halls are arranged', '', 'CLC0039.doc'),
('CLC0040', 'MEDICAL SHOP MANAGEMENT', 'SOFTWARE PROJECTS', 'CSO-OTHERS', 0, 2000, 'CLC0040', 'nil', 240, 'MEDICAL SHOP MANAGEMENT\r\nPROJECT DESCRIPTION\r\nThe medical shop management software is made to manage the data of different medicines. It stores the necessary information about any medicine like name, company, expiry date, MRP.  As soon as the user enters the needed medicine to the system, it searches and displays the medicines details along with the location of that medicine in your shop. Then it accepts the quantity of medicines required, calculates the cost and prints the bill. It can add new purchased medicine also.\r\n', '', 'CLC0040.doc'),
('CMC0085', 'A NEW LOW-COMPLEXITY SELECTED MAPPING SCHEME USING', 'MATLAB PROJECTS', 'CSM-MATLAB', 0, 3000, 'CMC0085', 'MODULATION TECHNIQUES', 241, 'In this paper, a new peak-to-average power ratio (PAPR) reduction scheme for orthogonal frequency\r\ndivision multiplexing (OFDM) is proposed based on the selected mapping (SLM) scheme. The proposed\r\nSLM scheme generates alternative OFDM signal sequences by cyclically shifting the connections in\r\neach subblock at an intermediate stage of inverse fast Fourier transform (IFFT). Compared with the\r\nconventional SLM scheme, the proposed SLM scheme achieves similar PAPR reduction performance\r\nwith much lower computational complexity and no bit error rate (BER) degradation. The performance\r\nof the proposed SLM scheme is verified through numerical analysis. Also, it is shown that the proposed\r\nSLM scheme has the lowest computational complexity among the existing low-complexity SLM schemes\r\nexploiting the signals at an intermediate stage of IFFT.', '', 'CMC0085.pdf'),
('CMW0096', 'A HIGH STEP-UP THREE-PORT DC-DC CONVERTER FOR STAN', 'MATLAB PROJECTS', 'CSM-MATLAB', 11000, 4000, 'CMW0096', 'POWER SYSTEM', 242, 'AbstractA three-port dc-dc converter integrating PV and battery power for high step-up applications is proposed in this paper. The topology includes five power switches, two coupled inductors and two active-clamp circuits. The coupled inductors are used to achieve high step-up voltage gain and to reduce the voltage stress of input side switches. Two sets of active-clamp circuits are used to recycle the energy stored in the leakage inductors and to improve the system efficiency. The operation mode does not need to be changed when a transition between charging and discharging occur. Moreover, tracking maximum power point of the PV source and regulating the output voltage can be operated simultaneously during charging/discharging transitions. As long as the sun irradiation level is not too low, the maximum power point tracking (MPPT) algorithm will be disabled only when the battery charging voltage is too high. Therefore, the control scheme of the proposed converter provides maximum utilization of PV power most of the time. As a result, the proposed converter has merits of high boosting level, reduced number of devices, and simple control strategy. Experimental results of a 200W laboratory prototype are presented to verify the performance of the proposed three-port converter.', '', 'CMW0096.pdf'),
('CMW0098', 'ELECTROMAGNETIC TRANSIENTS SIMULATION-BASED\r\nSURRO', 'MATLAB PROJECTS', 'CSM-MATLAB', 0, 5000, 'CMW0098', 'STATCOM', 243, 'AbstractThis paper introduces a computationally efficient\r\nsurrogate model-based approach for tolerance analysis of power\r\nsystems. Surrogate models are heuristic, simple representations\r\nof complex systems that are obtained through an automated sensitivity\r\nanalysis of electromagnetic transient simulations results.\r\nThese simpler models are shown in this paper to be significantly\r\nfaster than full-detail simulation models to obtain accurate statistical\r\ntolerance information about complex power networks.\r\nUsefulness of the proposed approach is demonstrated by two\r\napplication examples. In the first example, surrogate models are\r\nused for determining the statistical distribution of undesired remnant\r\nharmonics produced by a voltage-source converter, given the\r\nuncertainty in the firing angles. In the second example, the impact\r\nof variations in the system parameters around the nominal values\r\non the transient behavior of a static compensator is analyzed.', '', 'CMW0098.pdf'),
('CMW0099', 'OPTIMAL AND DIRECT-CURRENT VECTOR CONTROL OF\r\nDIRE', 'MATLAB PROJECTS', 'CSM-MATLAB', 0, 4000, 'CMW0099', 'GRID', 244, 'AbstractWith the advances of power electronic technology,\r\ndirect-driven permanent magnet synchronous generators\r\n(PMSGs) have increasingly drawn the interest of wind turbine\r\nmanufacturers. At the present time, a commercial PMSG wind\r\nturbine primarily makes use of a passive rectifier followed by an insulated\r\ngate bipolar transistor (IGBT) inverter. Although a PMSG\r\nwind turbine with two back-to-back voltage source IGBT converters\r\nis considered more efficient, it has not been widely adopted by\r\nthe wind power industry. This paper investigates both the conventional\r\nand a novel vector control mechanism for a PMSG wind\r\nturbine that has two side-by-side voltage source pulsewidth modulation\r\nconverters. The proposed approach is based on a directcurrent\r\nvector control mechanism for control of both machineand\r\ngrid-side converters of a PMSG wind turbine. Then, an optimal\r\ncontrol strategy is developed for integrated control of PMSG\r\nmaximum power extraction, reactive power, and grid voltage support\r\ncontrols. A transient system simulation using SimPowerSystem\r\nis built to investigate the performance of the conventional and\r\nproposed control techniques for the PMSG wind turbine under\r\nsteady and gusty wind conditions. This paper shows that when using\r\nthe direct-current vector control structure, a PMSG system has\r\nexcellent performance in various aspects.', '', 'CMW0099.pdf'),
('CMW0100', 'THE DIRECT CURRENT CONTROL METHOD OF STATCOM AND I', 'MATLAB PROJECTS', 'CSM-MATLAB', 0, 4000, 'CMW0100', 'STATCOM', 245, 'Abstract-This paper introduced the working principle of\r\nSTATCOM, uses the method of direct current control of\r\ntriangle carrier wave to detect both the harmonic and the basic\r\nreactive power. Used the Matlab to build the model of\r\nSTATCOM, The simulation and experimental results verified\r\nthe feasibility and effectiveness of this method, and good\r\ntracking performance, and accurately, fast and steady\r\ncompensation effect.', '', 'CMW0100.pdf'),
('CMP0215', '* A DCDC MULTIPORT-CONVERTER-BASED SOLID-STATE\r\nT', 'MATLAB PROJECTS', 'CSM-MATLAB', 20000, 5000, 'CMP0215', 'POWER SYSTEM', 246, 'AbstractThe Solid-state transformer (SST) has been proposed\r\nby researchers to replace the regular distribution transformer in\r\nthe future smart grid. The SST provides ports for the integration\r\nof storage and distributed generation (DG), e.g., photovoltaic (PV),\r\nand enables the implementation of power quality features. This paper\r\nproposes a SST topology based on a quad-active-bridge (QAB)\r\nconverter which not only provides isolation for the load, but also for\r\nDG and storage. A gyrator-based average model is developed for\r\na general multiactive-bridge (MAB) converter, and expressions to\r\ndetermine the power rating of theMABports are derived. These results\r\nare then applied to analyze theQAB converter. For the control\r\nof the dcdc stage of the proposed QAB-based SST integrating PV\r\nand battery, a technique that accounts for the cross-coupling characteristics\r\nof the QAB converter in order to improve the regulation\r\nof the high-voltage-dc link is introduced. This is done by transferring\r\nthe disturbances onto the battery. The control loops are\r\ndesigned using single-input single-output techniques with different\r\nbandwidths. The dynamic performance of the control strategy\r\nis verified through extensive simulation and experimental results.', 'CMP0215.jpg', 'CMP0215.pdf');
